import Layout from "../components/layout/layout";

function Product() {
  const position = {
    productwrapper: "w-3/5",
    imagewrapper: "w-2/5",
  };
  return (
    <Layout>
      <div>
        <div className={position.imagewrapper}>
          <h1>Product</h1>
        </div>
        <div className={position.productwrapper}></div>
      </div>
    </Layout>
  );
}

export default Product;
